use reqwest::blocking::get;
use clipboard::ClipboardProvider;
use tts::Speaker;

fn main() {
    // Read the contents of the clipboard.
    let mut clipboard = ClipboardProvider::new().unwrap();
    let clipboard_contents = clipboard.get_contents().unwrap();

    // Make a request to the ElevenLabs API to get TTS data for the clipboard contents.
    let response = get("https://api.elevenlabs.io/tts?text={}", &clipboard_contents)
        .unwrap()
        .text()
        .unwrap();

    // Parse the TTS data from the API response.
    let tts_data: TtsData = serde_json::from_str(&response).unwrap();

    // Use the `tts` crate to generate speech from the TTS data.
    let mut speaker = Speaker::new().unwrap();
    speaker.say(&tts_data.text).unwrap();
}

